import React from 'react';

const InventoryProducts = () => (
  <div>
    <h2>Products</h2>
    <ul>
      <li>Laptop (10 in stock)</li>
      <li>Monitor (5 in stock)</li>
    </ul>
  </div>
);

export default InventoryProducts;
